import React from "react";
import "./Projects.css";

const Projects = () => {
  let project = [
    {
      image: "",
      title: "e-Notebook",
      link: "",
      description: "A online notebook with signup and login options",
    },
    {
      image: "",
      title: "NewsDino",
      link: "",
      description: "A news app",
    },
    {
      image: "",
      title: "TextEditooor",
      link: "",
      description: "A text editing website that have multiple functions",
    },
    {
      image: "",
      title: "",
      link: "",
      description: "",
    },
  ];
  return (
    <>
      <section id="project-container" className="">
        <h2>Projects</h2>
        <hr />
        {project.map((elem) => {
          const {title, description, link, image}= elem
          return (
            <div className="card" style={{ width: "18rem" }} key= {title}>
              <img src={image} className="card-img-top" alt="..." />
              <div className="card-body">
                <h5 className="card-title">{title}</h5>
                <p className="card-text">
                  {description}
                </p>
                <a href="/" className="btn btn-primary">
                  {link}
                </a>
              </div>
            </div>
          );
        })}
      </section>
    </>
  );
};

export default Projects;
